import React from 'react';
import {Col} from 'reactstrap';
import {AboutContainer,AboutH1,Img} from './AboutElements';
import img from '../images/ABOUT.svg'

const About = () => {
    return (
        <AboutContainer>
            <Col lg={{size: 6, offset: 2}}>
            <AboutH1>ABOUT ME</AboutH1>
            <Img src={img} />
            </Col>
        </AboutContainer>
    )
}

export default About;
